x1, y1, x2, y2 = map(int, input().split())

if x1 == x2 and y1 == y2:
    print(x1, y1, x2, y2)
elif y1 == y2:
    print(x1, y1, x2, y1+x1-x2)
elif x1 == x2:
    print(x1, y1, x1+y1-y2, y2)
else:
    if (x1-x2)**2 + (y1-y2)**2 != 2 * (x1-x2)*(y1-y2):
        print(x1, y2, x2, y1)
    else:
        print(x1, y2, x2, y2)
